import React from 'react';
import { Grid } from '@material-ui/core';
import { Leftpane, Rightpane } from './../Layouts';

const style = {
  paper: {
    padding: 20,
    marginTop: 10,
    marginBottom:20,
  },
};

export default props => {
  return (
     <Grid container>
       <Grid item sm>
        <Leftpane styles={style}/>
       </Grid>
       <Grid item sm>
        <Rightpane styles={style}/>
       </Grid>
     </Grid>
  );
}
